import React from "react";
import PropTypes from "prop-types";
import AppLayout from "../components/AppLayout";
import { Head } from "next/head";

const profile = () => {
  return (
    <>
      <Head>
        <title>내 프로필 | sns</title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowList />
        <FollowList />
      </AppLayout>
      ;
    </>
  );
};

profile.propTypes = {};

export default profile;
